import React from 'react';
import {Route} from 'react-router-dom';
import './App.css';
import HomePage from './pages/homepage/homepage.component';


const HatsPage=()=>(
  <div>
  <h1>Hats PAGE</h1>
  </div>
)


function App() {
  return( 
  <div>
   <Route path='/' component={HomePage}/>
   <Route exact path='/shop/hats' component={HatsPage}/>
  </div>
  );
}

export default App;
